class Solution:
    def numWays(self, s: str) -> int:
        cnt = s.count('1')
        if cnt % 3:
            return 0
        if cnt == 0:
            tmp = len(s) - 1
            return tmp * (tmp-1)//2 % (10**9 + 7)

        num = cnt // 3
        left, right = 0, 0

        cur_num = 0
        for i in range(len(s)):
            if s[i] == '1':
                cur_num += 1
                if cur_num == num:
                    left = i
                    break

        cur_num = 0
        for i in range(len(s) - 1, -1, -1):
            if s[i] == '1':
                cur_num += 1
                if cur_num == num:
                    right = i
                    break

        s = s[left + 1:right]

        l = len(s) - len(s.lstrip('0'))
        r = len(s) - len(s.rstrip('0'))
        return (l + 1) * (r + 1) % (10**9 + 7)


